 4401Y, importe:   12,00, tickets: 1\r\n	Total: 33,45 eur (3 tickets)\r\nTaquilla: 1102\r\n	DNI: 4402Y, importe:    8,45, tickets: 1\r\n	DNI: 4404Y, importe:   12,00, tickets: 1\r\n	Total: 20,45 eur (2 tickets)\r\n-- Las comprobaciones de prueba son correctas, pero comprueba que la salida \r\n-- por consola sea idC)ntica a la esperada para confirmar que el resultado\r\n-- final es correcto.\r\n\r\n-- --------------------------------------------------------------\r\n-- PRUEBA 2: Ejecucion de excepcion del procedimiento.\r\n-- debe capturar excepcion para indicar que la puerta no existe.\r\n-- Ademas se comprueba si se han modificado las ventas de las taquillas.\r\n-- --------------------------------------------------------------\r\nLa puerta Sureste no existe.\r\n-- Las comprobaciones de prueba son correctas, pero comprueba que la salida \r\n-- por consola sea idC)ntica a la esperada para confirmar que el resultado\r\n-- final es correcto.\r\n\r\n-- --------------------------------------------------------------\r\n-- PRUEBA 3: Ejecucion de excepcion del procedimiento.\r\n-- debe capturar excepcion para indicar que la puerta no tiene\r\n-- entradas vendidas.\r\n-- --------------------------------------------------------------\r\nLa puerta Oeste no tiene entradas vendidas.\r\n-- Las comprobaciones de prueba son correctas, pero comprueba que la salida \r\n-- por consola sea identica a la esperada para confirmar que el resultado\r\n-- final es correcto.\r\n\r\n', NULL),
